  }
  if ($unicodecount($1-) > 18) {
    if ($me isop #) { 
      ban -u60 # $nick 2
      kick # $nick 0,12<15>0,2<15>12,1«[0 Unicode spam detected 12,1]»0,2<15>0,12<15>
    }
    if ($window(@Spam) == $null) { window -Cnbk0 +e @Spam }
    aline @Spam $timestamp $chan $nick $address($nick,1) $1-
    .auser uspam $address($nick,2) Unicode Spam $day
    halt
  }
}

on uspam:JOIN:#: { 
  if (($me isop #) && ($nick isreg $chan) && (*undernet.org !iswm $site)) {
    kick # $nick 0 144,5<1>1500 144,5<1>150 144,5<1>15 Unicode spam previously detected from this address. 1,5<4>15 1,5<4>15 1,5<4>
    ban -u60 # $nick 2
  } 
}

alias unicodecount {
  var %temp = $strip($1-)
  var %loop = 1
  var %length = $len(%temp)
  var %count = 0
  var %chr = 0
  while (%loop < %length) {
    %chr = $mid(%temp,%loop,1)
    if ($asc(%chr) > 255) { inc %count }
    inc %loop
  }
  return %count
}

