   def bot_move(self):
      valid_move = 0
      
      while valid_move == 0:
         move = random.randint(1,9)
         
         for i in range(len(self.board)):
            for k in range(len(self.board[i])):
               
               if self.board[i][k] == str(move):
                  
                  self.board[i][k] = self.bot
                  valid_move = 1
      
   #User makes a move
   def user_move(self):
      valid_move = 0
      
      while valid_move == 0:
         move = input('Enter your move: ')
         
         if move != 'X' and move != 'O':
            for i in range(len(self.board)):
               for k in range(len(self.board[i])):
                  if self.board[i][k] == move:
                     self.board[i][k] = self.user
                     valid_move = 1
                     
         if valid_move == 0:
            print('Invalid input')
            
   #Play Tic-tac-toe!
