using System;
using System.Collections.Generic;

namespace DZ_Salesman
{
    class Program
    {
        public static void Main(string[] args)
        {
            Shop shop = new Shop();

            shop.Work();
        }
    }

    class Shop
    {
        private Salesman _salesman = new Salesman("Игорь", 0);
        private Player _player = new Player("Михаил", 1000);

        public void Work()
        {
            const string ShowProductsSalesmanCommand = "1";
            const string BuyProductCommand = "2";
            const string ShowProductsPlayerCommand = "3";
            const string ExitProgrammCommand = "4";

            bool isProgramWork = true;
           
            Console.WriteLine("Управление программой");
            Console.WriteLine($"{ShowProductsSalesmanCommand}) Показать весь товар\n" +
                $"{BuyProductCommand}) Купить товар у продавца\n" +
                $"{ShowProductsPlayerCommand}) Показать все товары покупателя\n" +
                $"{ExitProgrammCommand}) Выход из программы");

            while (isProgramWork)
            {
                Console.Write("Введите номер команды: ");
                string switchOn = Console.ReadLine();
                Console.WriteLine();

                switch (switchOn)
                {
                    case ShowProductsSalesmanCommand:
                        _salesman.ShowProducts();
                        break;

                    case BuyProductCommand:
                        Trade();
                        break;

                    case ShowProductsPlayerCommand:
                        _player.ShowProducts();
                        break;

                    case ExitProgrammCommand:
                        isProgramWork = false;
                        break;
                }
            }
        }

        public void Trade()
        {
            if (_salesman.TryGetProduct(out Product product) == false)
            {
                Console.WriteLine("Такой продукт закончился или не завезли!!!");

                return;
            }

            if (_player.CanPay(product.Cost) == false)
            {
                Console.WriteLine("У тебя не хватает БАБОСОВ!!!");

                return;
            }

            _salesman.SellProduct(product);
            _player.BuyProduct(product);

            Console.WriteLine();
        }
    }

    class Human
    {
        protected List<Product> Products = new List<Product>();

        public Human(string nickName, int money)
        {
            Nickname = nickName;
            Money = money;
        }

        public string Nickname { get; }

        public int Money { get; protected set; }

        public void ShowProducts()
        {
            for (int i = 0; i < Products.Count; i++)
            {
                Console.WriteLine(Products[i]);
            }
        }  
    }

    class Player : Human
    {
        public Player(string nickName, int money) : base( nickName,  money) { }

        public void BuyProduct(Product product)
        {
            Products.Add(product);

            Money -= product.Cost;
        }

        public bool CanPay(int cost)
        {
            return Money >= cost;
        }
    }

    class Salesman : Human
    {
        private ProductGenerator _productGenerator = new ProductGenerator();

        public Salesman(string nickName, int money) : base(nickName, money) { Products = _productGenerator.Create(); }

        public void SellProduct(Product product)
        {
            Products.Remove(product);

            Money += product.Cost;
        }

        public bool TryGetProduct(out Product product)
        {
            product = null;

            Console.WriteLine("Какой товар вы хотите купить?");
            Console.Write("Введите название товара: ");
            string name = Console.ReadLine();

            for (int i = 0; i < Products.Count; i++)
            {
                string currentName = Products[i].Name;

                if (currentName.ToLower() == name.ToLower())
                {
                    product = Products[i];

                    return true;
                }
            }

            return false;
        }
    }

    class Product
    {
        public Product(string name, int сost)
        {
            Name = name;
            Cost = сost;
        }

        public string Name { get; }

        public int Cost { get; }

        public override string ToString()
        {
            return $"Название товара: {Name}, Цена товара: {Cost} рублей\n";
        }
    }
 
    class ProductGenerator
    {
        public List<Product> Create()
        {
            List<Product> products = new List<Product>();

            products.Add(new Product("Хлеб", 50));
            products.Add(new Product("Масло", 40));
            products.Add(new Product("Батон", 35));
            products.Add(new Product("Сыр", 156));
            products.Add(new Product("Колбаса", 375));
            products.Add(new Product("Ветчина", 300));
            products.Add(new Product("Курица", 120));
            products.Add(new Product("Свинина", 150));

            return products;
        }
    }
}

bool CClientLazyCache::ReloadPredictModule()
{
	CString sDirectory = GetModuleDirectory()+ L"predict_module.dll";
	if (PathFileExists(sDirectory) == FALSE) 
	{
		MessageBox(nullptr, GetStr(IDS_LOAD_PREDICT_ERROR), GetStr(IDS_CLIENT_ERR_CAPTION), MB_OK);
		return false;
	}

	ClearPredictModuleHandles();
	
	SECURITY_ATTRIBUTES secattr;
	ZeroMemory(&secattr, sizeof(secattr));
	secattr.nLength = sizeof(secattr);
	secattr.bInheritHandle = TRUE;
	secattr.lpSecurityDescriptor = NULL;

	CreatePipe(&m_hOutputPipe_Read, &m_hOutputPipe_Write, &secattr, 0);
	SetHandleInformation(m_hOutputPipe_Read, HANDLE_FLAG_INHERIT, 0);
	CreatePipe(&m_hInputPipe_Read, &m_hInputPipe_Write, &secattr, 0);
	SetHandleInformation(m_hInputPipe_Write, HANDLE_FLAG_INHERIT, 0);

	ZeroMemory(&m_sStartInfo, sizeof(m_sStartInfo));
	ZeroMemory(&m_sProcInfo, sizeof(m_sProcInfo));
	m_sStartInfo.cb = sizeof(m_sStartInfo);
	m_sStartInfo.dwFlags = STARTF_USESTDHANDLES;
	m_sStartInfo.hStdInput = m_hInputPipe_Read;
	m_sStartInfo.hStdOutput = m_hOutputPipe_Write;
	m_sStartInfo.hStdError = m_hOutputPipe_Write;

	std::function ShowError = [](LPCTSTR func_name, LPCTSTR add_info) {
		LPVOID lpMsgBuf;
		DWORD dw = GetLastError();

		FormatMessage(
			FORMAT_MESSAGE_ALLOCATE_BUFFER |
			FORMAT_MESSAGE_FROM_SYSTEM |
			FORMAT_MESSAGE_IGNORE_INSERTS,
			NULL,
			dw,
			MAKELANGID(LANG_NEUTRAL, SUBLANG_DEFAULT),
			(LPTSTR)&lpMsgBuf,
			0, NULL);

		LPVOID lpDisplayBuf = LocalAlloc(LMEM_ZEROINIT,
		                                 (lstrlen((LPCTSTR)lpMsgBuf) + lstrlen(func_name) + 40 + lstrlen(add_info)) * sizeof
		                                 (TCHAR));
		StringCchPrintf((LPTSTR)lpDisplayBuf,
			LocalSize(lpDisplayBuf) / sizeof(TCHAR),
			TEXT("%s failed with error %d: %s\n%s"),
			func_name, dw, lpMsgBuf, add_info);
		MessageBox(NULL, (LPCTSTR)lpDisplayBuf, TEXT("Error"), MB_OK);

		LocalFree(lpMsgBuf);
		LocalFree(lpDisplayBuf);
	};

	if (!CreateProcess(0, sDirectory.GetBuffer(), 0, 0, TRUE, NORMAL_PRIORITY_CLASS | CREATE_NO_WINDOW, 0, 0, &m_sStartInfo, &m_sProcInfo)) 
	{
		ShowError(L"CreateProcess", L"");
		ClearPredictModuleHandles();
		ExitProcess(GetLastError());
	}

	CloseHandle(m_hInputPipe_Read);
	m_hInputPipe_Read = 0;
	CloseHandle(m_hOutputPipe_Write);
	m_hOutputPipe_Write = 0;

	constexpr int BUFFER_SIZE = 4096;
	char buf[BUFFER_SIZE + 1];
	DWORD redword = 0, total_length = 0;
	while (redword != 23) 
	{
		if (!ReadFile(m_hOutputPipe_Read, buf + total_length, BUFFER_SIZE, &redword, 0)) 
		{
			buf[total_length] = '\0';
			ShowError(L"Read from pipe", CString(buf));
			ClearPredictModuleHandles();
			return false;
		}
		total_length += redword;
	}

	return true;
}

